(self.webpackChunklearn_docs=self.webpackChunklearn_docs||[]).push([[26],{737:(e,a,i)=>{"use strict";i.r(a),i.d(a,{data:()=>t});const t={key:"v-1ed782c4",path:"/prototyypimine/",title:"PROTOTÜÜPIMINE",lang:"et",frontmatter:{},excerpt:"",headers:[{level:2,title:"16.03.2021",slug:"_16-03-2021",children:[]},{level:2,title:"23.03.2021",slug:"_23-03-2021",children:[]}],filePathRelative:"prototyypimine/README.md",git:{updatedTime:1616503313e3,contributors:[{name:"unknown",email:"meelis.mannari@tptlive.ee",commits:4}]}}},925:(e,a,i)=>{"use strict";i.r(a),i.d(a,{default:()=>l});const t=(0,i(252).uE)('<h1 id="prototuupimine"><a class="header-anchor" href="#prototuupimine">#</a> PROTOTÜÜPIMINE</h1><p>Siia lehele ma koondan kõik prototüüpimise tööd.</p><h2 id="_16-03-2021"><a class="header-anchor" href="#_16-03-2021">#</a> 16.03.2021</h2><p>Vaatame üle, kaugele keegi oma prototüübiga on jõudnud.</p><p>Jätsin meelde, et tumedat teksti tumeda taustapeale peale ei tohi panna, kuigi erandjuhtudes võib mingil hetkel sobida.</p><p>Pean rohkem guugeldama ja uurima tänapäeva uusi trende.</p><p>Fonte peab õppima rohkem ja saama aru nendest.</p><p>Värvipalette peab enda jaoks leidma millised mulle meeldivad ja milliseid oleks mõistlik millises kohas kasutada.</p><h2 id="_23-03-2021"><a class="header-anchor" href="#_23-03-2021">#</a> 23.03.2021</h2><p>Parandame enda vigu XD projektis. Pealmiselt vigade märksõnad on - CRAP Joondamine, koondamine, tasakaalustamine, kontrast. Valime Google Fonts&#39;idest endale sobiv pealkirjafont mis läheks väljamõeldud organisatsiooniga kokku. Google Fonts pakub ka alapealkirju mis sobivad pealkirjafondiga kokku. Samuti tuleb määrata pealkirjade, alapealkirjade ja sisu fondid stiilide abil.</p>',10),l={render:function(e,a){return t}}}}]);